import React from "react";
import {
  Card,
  CardBody,
  CardHeader,
  Col,
  Row,
  ListGroupItem,
  ListGroup
} from "reactstrap";

const OldMatch = ({ oldMatch }) => {
  console.log(oldMatch);
  return (
    <Row>
      <Col xs="12">
        <Card>
          <CardHeader>
            <i className="fa fa-align-justify"></i> Random match results on{" "}
            {oldMatch.dateMatch}
          </CardHeader>
          <CardBody>
            <Row>
              <Col xs={12} sm={6}>
                <ListGroup>
                  {oldMatch.blueTeam.map(i => {
                    return <ListGroupItem key={i}> {i} </ListGroupItem>;
                  })}
                </ListGroup>
              </Col>
              <Col xs={12} sm={6}>
                <ListGroup>
                  {oldMatch.redTeam.map(i => {
                    return <ListGroupItem key={i}> {i} </ListGroupItem>;
                  })}
                </ListGroup>
              </Col>
            </Row>
          </CardBody>
        </Card>
      </Col>
    </Row>
  );
};

export default OldMatch;
